import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import ServiceSelection from './components/ServiceSelection';
import EmojiSelection from './components/EmojiSelection';
import FeedbackForm from './components/FeedbackForm';

function App() {
  const [serviceType, setServiceType] = useState('');
  const [emojiFeedback, setEmojiFeedback] = useState('');

  return (
    <Router>
      <Routes>
        <Route path="/" element={<ServiceSelection setServiceType={setServiceType} />} />
        <Route path="/emoji-selection" element={<EmojiSelection serviceType={serviceType} setEmojiFeedback={setEmojiFeedback} />} />
        <Route path="/feedback-form" element={<FeedbackForm serviceType={serviceType} emojiFeedback={emojiFeedback} />} />
      </Routes>
    </Router>
  );
}

export default App;
